BEGIN
    DECLARE ID_PRODOTTO INT;
    DECLARE QUANTITA_PRODOTTO INT;
    DECLARE ID_MAGAZZINO INT;
    DECLARE DESCRIZIONE_MAGAZZINO VARCHAR(255);
    DECLARE DESCRIZIONE_NUOVO_MAGAZZINO VARCHAR(255);
    DECLARE RapportoDaDDT CHAR(1);
    DECLARE FINITO INT DEFAULT FALSE;

    DECLARE CursorVoci CURSOR FOR
        SELECT rapporti_intervento_forniture.ID_PRODOTTO,
               rapporti_intervento_forniture.QUANTITA_EFFETTUATA,
               rapporti_intervento.ID_MAGAZZINO,
               magazzini.DESCRIZIONE,
               impostazioni.RAPPORTO_INTERVENTO_COME_DDT
          FROM rapporti_intervento_forniture
          JOIN rapporti_intervento ON rapporti_intervento.CHIAVE = rapporti_intervento_forniture.ID_RAPPORTO
          JOIN magazzini ON magazzini.CHIAVE = rapporti_intervento.ID_MAGAZZINO
          JOIN impostazioni ON 1 = 1
         WHERE rapporti_intervento_forniture.ID_RAPPORTO = OLD.CHIAVE;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET FINITO = TRUE;

    OPEN CursorVoci;
    LoopVoci: LOOP
        FETCH CursorVoci INTO ID_PRODOTTO, QUANTITA_PRODOTTO, ID_MAGAZZINO, DESCRIZIONE_MAGAZZINO, RapportoDaDDT;
        IF FINITO THEN LEAVE LoopVoci; END IF;

        IF RapportoDaDDT = 'T' AND COALESCE(QUANTITA_PRODOTTO,0) <> 0 THEN
            IF OLD.ID_MAGAZZINO <> NEW.ID_MAGAZZINO THEN
                	CALL INCREMENTA_MAGAZZINO(ID_PRODOTTO, OLD.ID_MAGAZZINO, QUANTITA_PRODOTTO);
                	
	            	SELECT DESCRIZIONE 
						  INTO DESCRIZIONE_MAGAZZINO 
						  FROM magazzini 
						 WHERE CHIAVE = OLD.ID_MAGAZZINO;
						 
		            INSERT INTO log_magazzino (CHIAVE, DATA, ID_PRODOTTO, ID_MAGAZZINO, QUANTITA, DESCRIZIONE)
		            VALUES (GET_NEW_KEY(), NOW(), ID_PRODOTTO, OLD.ID_MAGAZZINO, QUANTITA_PRODOTTO,
		                    CONCAT('Modificato magazzino in rapporto ', NEW.CHIAVE, '.
Ripristino quantit in vecchio magazzino - ', DESCRIZIONE_MAGAZZINO));
		
		            CALL INCREMENTA_MAGAZZINO(ID_PRODOTTO, NEW.ID_MAGAZZINO, -QUANTITA_PRODOTTO);
		            
		            SELECT DESCRIZIONE 
						  INTO DESCRIZIONE_NUOVO_MAGAZZINO 
						  FROM magazzini 
						 WHERE CHIAVE = NEW.ID_MAGAZZINO;
						 
		            INSERT INTO log_magazzino (CHIAVE, DATA, ID_PRODOTTO, ID_MAGAZZINO, QUANTITA, DESCRIZIONE)
		            VALUES (GET_NEW_KEY(), NOW(), ID_PRODOTTO, NEW.ID_MAGAZZINO, -QUANTITA_PRODOTTO,
		                    CONCAT('Modificato magazzino in rapporto ', NEW.CHIAVE, '.
Spostamento quantit in nuovo magazzino - ', DESCRIZIONE_NUOVO_MAGAZZINO));
            END IF;
        END IF;
    END LOOP;
    CLOSE CursorVoci;
END

BEGIN
    DECLARE QUANTITAPRODOTTO INT;
    DECLARE ID_MAGAZZINO INT;
    DECLARE DESCRIZIONE_MAGAZZINO VARCHAR(255);
    DECLARE RapportoDaDDT CHAR(1);

    SELECT impostazioni.RAPPORTO_INTERVENTO_COME_DDT,
           rapporti_intervento.ID_MAGAZZINO,
           magazzini.DESCRIZIONE
      INTO RapportoDaDDT,
           ID_MAGAZZINO,
           DESCRIZIONE_MAGAZZINO
      FROM impostazioni, rapporti_intervento, magazzini
     WHERE rapporti_intervento.CHIAVE = NEW.ID_RAPPORTO
       AND magazzini.CHIAVE = rapporti_intervento.ID_MAGAZZINO;

    IF RapportoDaDDT = 'T' AND NEW.QUANTITA_EFFETTUATA <> 0 THEN
        SET QUANTITAPRODOTTO = NEW.QUANTITA_EFFETTUATA;
	   
        CALL INCREMENTA_MAGAZZINO(NEW.ID_PRODOTTO, ID_MAGAZZINO, QUANTITAPRODOTTO * (-1));
		 
        INSERT INTO log_magazzino (CHIAVE, DATA, ID_PRODOTTO, ID_MAGAZZINO, QUANTITA, DESCRIZIONE)
        VALUES (GET_NEW_KEY(), NOW(), NEW.ID_PRODOTTO, ID_MAGAZZINO, QUANTITAPRODOTTO * (-1), CONCAT('Aggiunta voce in rapporto ', NEW.ID_RAPPORTO, ' - magazzino ', DESCRIZIONE_MAGAZZINO));
    END IF;
  END

BEGIN
    DECLARE DELTA_Q INT DEFAULT (NEW.QUANTITA_EFFETTUATA - OLD.QUANTITA_EFFETTUATA);
    DECLARE ID_MAGAZZINO INT;
    DECLARE DESCRIZIONE_MAGAZZINO VARCHAR(255);
    DECLARE RapportoDaDDT CHAR(1);

    SELECT 
        rapporti_intervento.ID_MAGAZZINO,
        magazzini.DESCRIZIONE,
        impostazioni.RAPPORTO_INTERVENTO_COME_DDT
      INTO 
        ID_MAGAZZINO,
        DESCRIZIONE_MAGAZZINO,
        RapportoDaDDT
      FROM rapporti_intervento
      JOIN magazzini ON magazzini.CHIAVE = rapporti_intervento.ID_MAGAZZINO
      JOIN impostazioni
     WHERE rapporti_intervento.CHIAVE = NEW.ID_RAPPORTO
     LIMIT 1;

